column56:
Sandwell Metropolitan Borough Council (the Council) consists of six towns; Oldbury, Rowley Regis, Smethwick, Tipton, Wednesbury and West Bromwich. The Borough has an area of 8,600 hectares and serves a population of approximately 325,000.  The Council provides preventative services it to residents and is always striving to improve and expand the services available to vulnerable, elderly and disabled residents.  The Council is seeking to appoint a contractor to manage and deliver its Minor Adaptations and Handyperson Service.  The services to be provided are key to delivering the following outcomes; o Allowing vulnerable, elderly and disabled residents to remain living independently in their homes;  o  Reducing the numbers of home accidents, hospital admissions and re-admissions that are the result of slips, trips and falls;
      o Supporting the needs of the vulnerable and elderly;  o Maintaining the private housing stock of the Borough.

Additional information: Is a Recurrent Procurement Type? : No
